import Header from './components/Header/index';
import pic from './components/image/smarthome.jpg';

function App() {
  return (
    <div className="App">
      <Header />

      <div className="main">
        <img src={pic} />

        <div className='login'>

        </div>
      </div>
    </div>
  );
}

export default App;
